import React, { Component } from 'react';
import logo from './j.svg';

import './userprofile.css';


class App extends Component {
  render() {
    return (

      <div className="App">

        {/* Menu top bar */}
        <div className="notification-bar">

        {/* Anthologist logo */}
        <div className="head">
          <h1 className="head1">
            <a className="logo" href>anthologist</a>
          </h1>
        </div>

        {/* Search Bar */}
        <input className="in" type="text" ></input>
        <button className="notify"><img className="notimg" src={logo}></img> </button>
        <button className="user"><img className="userimg" src='avatar.png'></img> </button>
         <button className="search"><img className="searchimg" src='search.png'></img> </button>

        </div>  



      </div>
    );
  }
}

export default App;
